const SectionsCV = () => {
  return (
    <ul>
      <li>
        <h4>FORMACIÓN</h4>
        <p>
          09/10{" "}
          <strong>ERASMUS, EUROPEAN THEATRE ARTS. ROSE BRUFORD COLLEGE.</strong>{" "}
          Londres. <br />
          06/10 <strong>LICENCIADA EN INTERPRETACIÓN.</strong> Opción Textual.
          ESAD. Valencia. <br />
          03/06 <strong>
            DIPLOMADA EN TURISMO. E.S.T. WELTON y UNED.
          </strong>{" "}
          Vigo.
        </p>
      </li>
      <li>
        <h4>LARGOMETRAJES</h4>
        <p>
          2017 <strong>"YERMA"</strong> Londres. <br />
          06/10 <strong>LICENCIADA EN INTERPRETACIÓN.</strong> Opción Textual.
          ESAD. Valencia. <br />
          03/06 <strong>
            DIPLOMADA EN TURISMO. E.S.T. WELTON y UNED.
          </strong>{" "}
          Vigo.
        </p>
      </li>
    </ul>
  );
};
export default SectionsCV;
